/*********** Colors ***********/
@import url("https://fonts.googleapis.com/css?family=Roboto:400,500,500i,700,700i");
body {
  margin: 0px;
  padding: 0px;
  font-family: "Roboto";
}

.container {
  margin-left: auto;
  margin-right: auto;
  padding-right: 8px;
  padding-left: 8px;
}

.values_title {
  font-weight: 700;
  font-size: 2rem;
  margin-top: 1.1rem;
  text-align: center;
  color: #1e629f;
}

.values_text {
  font-size: 1.2rem;
  text-align: center;
}

.values_text_2 {
  color: #1e629f;
  text-align: center;
}

.care_text {
  font-weight: 500;
}

.care_title_2 {
  padding-bottom: 50px;
}

img {
  width: 100px;
  height: 100px;
}

.care {
  background: url(bfcae98b703d15b9ae6f3a2aee5774c3.jpg) no-repeat #1e629f;
  background-size: cover;
  background-position: 15% 0;
  color: #1e629f;
}

.care_text {
  padding-bottom: 40px;
}

.care_title {
  padding-top: 40px;
}

.number {
  background-image: linear-gradient(-180deg, #fafafa, #fff);
}

.title_number {
  margin: 0 auto 4.5rem;
  font-size: 1.6rem;
  font-weight: 700;
  text-align: center;
  color: #1E629F;
  padding-top: 60px;
}

.card_number {
  width: 100%;
  height: 250px;
  background-color: #FAFAFA;
  margin: 40px auto;
  box-shadow: 0 3px 6px -6px black;
}

.card_number1 span {
  color: #927EEC;
  font-size: 4em;
}

.card_number2 span {
  color: #4A7DD8;
  font-size: 4em;
}

.card_number3 span {
  color: #6DE8D7;
  font-size: 4em;
  font-size: 4em;
}
.card_number3 p {
  font-weight: 300;
}

.customer {
  background-color: #EAEAEA;
}
.customer a {
  color: #1E629F;
  background-color: #F6D950;
  text-decoration: none;
}
.customer p {
  color: #1E629F;
  font-size: 20px;
  font-weight: 700;
}
.customer .text_customer_card {
  background-color: #FFFFFF;
  box-shadow: -1px 2px -1px -2px #333333;
  padding: 30px;
}
.customer .text_customer_card img {
  width: 65px;
  height: 65px;
  margin-top: 20px;
}
.customer .text_customer_card p {
  color: #333333;
  font-size: 14px;
}
.customer .text_customer_card p .customer_card {
  color: #1E629F;
}
.customer .text_customer_card p span {
  color: #1E629F;
}

.footer {
  background-color: #333333;
  padding: 0px;
  margin: 0px;
}

.img_container {
  padding-top: 40px;
}

.footer_img {
  width: 50px;
  height: 50px;
}

.footer_text {
  color: white;
  text-decoration: none;
  font-size: 0.9rem;
}

.footer_subtitle {
  color: white;
  font-weight: 600;
  font-size: 1em;
  margin-bottom: 5px;
}

.footer_logo {
  width: 200px;
  margin-top: 20px;
}
